import React, { Component } from 'react';
import Navbar from './Navbar';

class App extends Component {
  state = {
  }

 

  render() {
    return (
            <div>
                <Navbar title="React + API"/>
                <div id="intro">
                    <div class="container-fluid d-flex align-items-center justify-content-center h-100">
                        <div class="row d-flex justify-content-center text-center">
                            <div class="col-md-10">
                                <h2 class="display-4 text-dark pt-10 mb-2">Welcome to the React + API Challenge Landing Page</h2>
                                
                                <h4 class="text-dark my-4">Climber. Tinkerer. Traveler.</h4>
                                
                                <a class="nav-link" href="#bio"><button type="button" class="btn btn-outline-dark">Read more</button></a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
          );
  }
}

export default App;
